function calcGradientPos(x2,y2,c2,x3,y3,c3)
{
	var a = y2*c3 - y3*c2;
	var b = x2*c3 - x3*c2;
	var q = y2*x3 - x2*y3;
	var d = a*a+b*b;
	if(d == 0) return [x3,y3];
	var m = c3*q/d;
	return [m*a, -m*b];
}

function calcFullGradientPos(x1,y1,c1,x2,y2,c2,x3,y3,c3)
{
	var shiftedPos = calcGradientPos(x2-x1,y2-y1,c2-c1,x3-x1,y3-y1,c3-c1);
	return [shiftedPos[0]+x1, shiftedPos[1]+y1];
}

function getGradient(ctx, r,g,b, x1,y1,c1,x2,y2,c2,x3,y3,c3)
{
	var pos = calcFullGradientPos(x1,y1,c1,x2,y2,c2,x3,y3,c3)
	var gradient = ctx.createLinearGradient(x1,y1, pos[0], pos[1]);
	gradient.addColorStop(0, "rgb("+Math.floor(r*c1)+","+Math.floor(g*c1)+","+Math.floor(b*c1)+")");
	gradient.addColorStop(1, "rgb("+Math.floor(r*c3)+","+Math.floor(g*c3)+","+Math.floor(b*c3)+")");
	return gradient;
}

function paintGradientTriangle(ctx, r,g,b, vert)
{
	vert.sort(function(a,b) {return b[2]-a[2]});
	ctx.fillStyle = getGradient(ctx, r,g,b, vert[0][0],vert[0][1],vert[0][2],vert[1][0],vert[1][1],vert[1][2],vert[2][0],vert[2][1],vert[2][2])
	ctx.beginPath();
	ctx.moveTo(vert[0][0],vert[0][1]);
	ctx.lineTo(vert[1][0],vert[1][1]);
	ctx.lineTo(vert[2][0],vert[2][1]);
	ctx.fill();
}


function calcVerticesNormals(vertex_list, mesh_list, normal_list)
{
	var vertex_normals = [];
	for(var i=0; i<vertex_list.length; i++)
	{
		var cur_normal = {x:0,y:0,z:0};
		for(var j=0; j<mesh_list.length; j++)
		{
			if(mesh_list[j].a == i || mesh_list[j].b == i || mesh_list[j].c == i)
			{
				var normal = normal_list[mesh_list[j].n];
				cur_normal.x+=normal.x;
				cur_normal.y+=normal.y;
				cur_normal.z+=normal.z;
			}
		}
		var len = Math.sqrt(cur_normal.x*cur_normal.x+cur_normal.y*cur_normal.y+cur_normal.z*cur_normal.z);
		vertex_normals[i] = {x:cur_normal.x/len, y:cur_normal.y/len, z:cur_normal.z/len};
	}
	return vertex_normals;
}

       function rotate_on_Z( vertex, angle )
       {
           temp_x = vertex.x;
           temp_y = vertex.y;

           //vertex.x = temp_x * Math.cos(angle) - temp_y * Math.sin(angle);
           //vertex.y = temp_x * Math.sin(angle) + temp_y * Math.cos(angle);

           vertex.x = temp_x * Math.cos(angle) + temp_y * Math.sin(angle);
           vertex.y = temp_y * Math.cos(angle) - temp_x * Math.sin(angle);
       }
       function rotate_on_X( vertex, angle )
       {

           temp_y = vertex.y;
           temp_z = vertex.z;

           vertex.y = temp_y * Math.cos(angle) + temp_z * Math.sin(angle);
           vertex.z = temp_z * Math.cos(angle) - temp_y * Math.sin(angle);
       }
       function rotate_on_Y( vertex, angle )
       {

           temp_z = vertex.z;
           temp_x = vertex.x;

           vertex.z = temp_z * Math.cos(angle) + temp_x * Math.sin(angle);
           vertex.x = temp_x * Math.cos(angle) - temp_z * Math.sin(angle);

       }
       function rotate_on_Y_cs( vertex, cosAngle, sinAngle )
       {

           temp_z = vertex.z;
           temp_x = vertex.x;

           vertex.z = temp_z * cosAngle + temp_x * sinAngle;
           vertex.x = temp_x * cosAngle - temp_z * sinAngle;

       }
       function sort_by_Z(i, ii) { // (возрастание)

           var sZ_i = ( i[0].z + i[1].z + i[2].z ) ;
           var sZ_ii = ( ii[0].z + ii[1].z + ii[2].z ) ;

           //console.log( 'i[0].z:' + i[0].z + '  ii[0].z: ' + ii[0].z);

           if (sZ_i > sZ_ii)
               return 1;
           else if (sZ_i < sZ_ii)
               return -1;
           else
               return 0;
       }

